package main

import (
    "fmt"
)

func main() {
    fmt.Println(minWindow("", ""))
}

func minWindow(s string, t string) string {
    left, right := 0, 0
    windows := make([]string, 0)
    minStr := s+t
    for right < len(s) {
        windows = append(windows, string(s[right]))
        right++
        for valid(windows, t) && left < right {
            str := func() string {
                f := ""
                for _, v := range windows {
                    f += v
                }
                return f
            }()
            if len(str) < len(minStr) {
                minStr = str
            }

            windows = append([]string{}, windows[1:]...)
            left++
        }
    }
    if len(minStr) > len(s) {
        return ""
    }
    return minStr
}

func valid(windows []string, t string) bool {
    windowsDeep := make([]string, 0)
    windowsDeep = append(windowsDeep, windows...)

    for _, v := range t {
        vStr := string(v)
        c := false
        for i, v := range windowsDeep {
            if v == vStr {
                c = true
                if i == 0 {
                     windowsDeep = append([]string{}, windowsDeep[1:]...)
                } else if i == len(windowsDeep) - 1 {
                    windowsDeep = append([]string{}, windowsDeep[0:(len(windowsDeep) - 1)]...)
                } else {
                    windowsDeep = append(windowsDeep[0:i], windowsDeep[(i+1):]...)
                }
                break
            }
        }
        if !c {
            return false
        }
    }
    return true
}